import axios from 'axios'

const uri="http://localhost:8080/DLitheEbuddy-0.0.1-SNAPSHOT/ws/"

export const iterate=async()=>{
    alert("API Called")
    const tmp=await axios.get(`${uri}/`)
    alert("In API"+tmp.data.length);
}
